      mainWrapper:{
            marginLeft:50,
            marginRight:50,
            marginTop:120,
            lineHeight:1,
        },
        headerImg:{
            
                width:"80%"
        },
        headertext:{
            font: "Calibri",
            fontSize:55,
            fontWeight:"bold",
        },
        headerParagraph:{
            font: "normal normal normal Calibri",
            letterSpacing: 0,
            fontSize:27,
            color:"#BBB5B5"
        },
        buttonContainer:{
            
